CREATE TABLE `informacion_lineas` (
  `id` int(11) NOT NULL,
  `modulo` varchar(100) NOT NULL,
  `nombre` varchar(100) NOT NULL,
  `numero_licencia` varchar(40) NOT NULL,
  `genero` varchar(10) DEFAULT NULL,
  `municipio` varchar(250) DEFAULT NULL,
  `linea_captura` varchar(20) NOT NULL,
  `tipo` char(1) DEFAULT NULL COMMENT 'A, B, C, D, P',
  `concepto_pago` int(11) DEFAULT NULL COMMENT '2 = Condonada, 3 = Pagada',
  `fecha_recepcion` date NOT NULL COMMENT 'Se llama fecha_recepcion pero es la fecha de la línea de captura',
  `validado` int DEFAULT 2 COMMENT '2 = No validado, 3 = Validado, 4 = Repetida',
  `repetido` int DEFAULT 0 COMMENT '0 = no repetido, cualquier otro numero es su vez repetido',
  `documento` varchar(255) NOT NULL COMMENT 'Es el documento del que llego, mas un consecutivo',
  'concepto_prioritario' varchar(255) NULL COMMENT 'Es el concepto principal de pago',
  'estado_transaccion' varchar(255) NULL COMMENT 'Es el estado de la transaccion, puede ser pagado, inexistente, formato invalido, etc.',
  'respuesta_anidada' text NULL COMMENT 'Son todos los conceptos de pago devueltos por la OVH',
  'total_pagado' varchar(255) NULL COMMENT 'Es el total pagado de la linea de captura',
  `id_usuario` int(11) NOT NULL,
  `onCreate` timestamp NOT NULL DEFAULT current_timestamp(),
  `onUpdate` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp()
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

CREATE TABLE `lineas_validas` (
  `id` int(11) NOT NULL,
  `id_linea` int(11) NOT NULL,
  `id_correcion` int(11) NOT NULL DEFAULT 0,
  `id_usuario` int(11) NOT NULL,
  `fecha_verificacion` date NOT NULL,
  `onCreate` timestamp NOT NULL DEFAULT current_timestamp()
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

CREATE TABLE `lineas_rebotadas` (
  `id` int(11) NOT NULL,
  `id_linea` int(11) NOT NULL,
  `linea_captura` varchar(20) NOT NULL,
  `estado` int(11) NOT NULL DEFAULT 2 COMMENT '2 = línea rebotada, 3 = revisada y rebotada, 4 = línea aprobada',
  'concepto_prioritario' varchar(255) NULL COMMENT 'Es el concepto principal de pago',
  'estado_transaccion' varchar(255) NULL COMMENT 'Es el estado de la transaccion, puede ser pagado, inexistente, formato invalido, etc.',
  'respuesta_anidada' text NULL COMMENT 'Son todos los conceptos de pago devueltos por la OVH',
  'total_pagado' varchar(255) NULL COMMENT 'Es el total pagado de la linea de captura',
  `id_usuario` int(11) NOT NULL,
  `fecha_verificacion` date NOT NULL,
  `onCreate` timestamp NOT NULL DEFAULT current_timestamp()
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

CREATE TABLE `modulos` (
